import "./landing.scss";
import smile from "../../img/smile.svg";
import { useEffect, useRef } from "react";
import { init } from "ityped";

export default function Landing() {
  const textRef = useRef();
  useEffect(() => {
    init(textRef.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: [
        "Software Developer",
        "Technical Writer",
        "IT Generalist",
        "Security Enthusiast",
      ],
    });
  });
  return (
    <div className="landing">
      <div className="heading-wrapper">
        <h1>Digital Carpentry</h1>
        <h1>
          Turning Ideas &gt;
          <img className="smile-icon" src={smile} alt=""></img>
        </h1>
        <p className="text-fade-in upper-text">Meet Tobias</p>
        <div className="text-fade-in text-wrapper">
          <p ref={textRef}></p>
        </div>
        <span></span>
      </div>
    </div>
  );
}
